  false,\n\t\"url\": null,\n\t\"notes\": \"Chautauqua National Wildlife Refuge's timber
  resource is largely black oak, black jack oak, hickory, elm, swamp maple, pecan,
  cottonwood, sycamore, and willow. Timber associations are of two types; swamp maple,
  cottonwood, and willow found in the Illinois River floodway, and oak, hickory, and
  elm found on the sand dune bluff. This plan describes the recommendations for timber
  harvesting, removal, and conversations in four areas.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
